 "Reflection is a teaching method often used to \nconnect theory to practice. Reflection tasks often provide learners with an \nopportunity to observe and reflect on their observations before presenting \nthese as a piece of academic work. Journals, diaries, profiles and portfolios \nare useful tools for collecting observation data. Rubrics and guides can be \neffective feedback tools.": "\u1780\u17b6\u179a\u200b\u1786\u17d2\u179b\u17be\u1799\u178f\u1794\u200b\u1797\u17d2\u179b\u17b6\u1798\u17d7 \u1782\u17ba\u200b\u1787\u17b6\u200b\u179c\u17b7\u1792\u17b8\u179f\u17b6\u179f\u17d2\u178a\u17d2\u179a\u200b\u1794\u1784\u17d2\u179a\u17c0\u1793 \u178a\u17c2\u179b\u200b\u1787\u17b6\u1789\u17b9\u1780\u1789\u17b6\u1794\u17cb \n\u178f\u17d2\u179a\u17bc\u179c\u1794\u17b6\u1793\u200b\u1794\u17d2\u179a\u17be\u200b\u178a\u17be\u1798\u17d2\u1794\u17b8\u200b\u1797\u17d2\u1787\u17b6\u1794\u17cb\u200b\u1791\u17d2\u179a\u17b9\u179f\u17d2\u178a\u17b8\u200b\u1791\u17c5\u200b\u1793\u17b9\u1784\u200b\u1780\u17b6\u179a\u200b\u17a2\u1793\u17bb\u179c\u178f\u17d2\u178f\u00a0\u17d4 \u1780\u17b7\u1785\u17d2\u1785\u1780\u17b6\u179a\u200b\u1786\u17d2\u179b\u17be\u1799\u178f\u1794\u200b\u1797\u17d2\u179b\u17b6\u1798\u17d7 \u1795\u17d2\u178a\u179b\u17cb\u200b\u17b1\u1780\u17b6\u179f\u200b\u17b2\u17d2\u1799\u200b \n\u17a2\u17d2\u1793\u1780\u200b\u179f\u17b7\u1780\u17d2\u179f\u17b6\u200b\u1794\u17d2\u179a\u178f\u17b7\u1794\u178f\u17d2\u178f\u17b7\u178f\u17b6\u1798 \u1793\u17b7\u1784\u200b\u1786\u17d2\u179b\u17be\u1799\u200b\u178f\u1794\u200b\u1791\u17c5\u200b\u1793\u17b9\u1784\u200b\u1780\u17b6\u179a\u200b\u179f\u1784\u17d2\u1780\u17c1\u200b\u178f\u200b\u1798\u17bb\u1793\u1796\u17c1\u179b\u200b\u1794\u1784\u17d2\u17a0\u17b6\u1789\u200b\u1787\u17b6 \n\u1785\u17c6\u178e\u17c2\u1780\u200b\u1793\u17c3\u200b\u1780\u17b6\u179a\u200b\u1784\u17b6\u179a\u200b\u179f\u17b7\u1780\u17d2\u179f\u17b6\u00a0\u17d4 \u1792\u17b6\u178f\u17bb\u200b\u1791\u17b7\u1793\u17b6\u1793\u17bb\u1794\u17d2\u1794\u179c\u178f\u17d2\u178f\u17b7 \u1780\u17c6\u178e\u178f\u17cb\u200b\u17a0\u17c1\u178f\u17bb\u200b\u1794\u17d2\u179a\u1785\u17b6\u17c6\u1790\u17d2\u1784\u17c3 \u1791\u1798\u17d2\u179a\u1784\u17cb \u1793\u17b7\u1784\u17a2\u17b6\u179b\u17cb\u1794\u17ca\u17bb\u1798 \n\u179a\u17bc\u1794\u1797\u17b6\u1796 \u1782\u17ba\u200b\u1787\u17b6\u200b\u17a7\u1794\u1780\u179a\u178e\u17cd\u200b\u1798\u17b6\u1793\u200b\u1794\u17d2\u179a\u1799\u17c4\u1787\u1793\u17cd\u200b\u179f\u1798\u17d2\u179a\u17b6\u1794\u17cb\u200b\u1794\u17d2\u179a\u1798\u17bc\u179b\u1795\u17d2\u178a\u17bb\u17c6\u200b\u1791\u17b7\u1793\u17d2\u1793\u1793\u17d0\u1799\u200b\u179f\u1784\u17d2\u1780\u17c1\u178f\u00a0\u17d4 \u1785\u17c6\u178e\u1784\u1787\u17be\u1784\u200b\u1798\u17bb\u1781 \n\u1793\u17b7\u1784\u200b\u1798\u1782\u17d2\u1782\u17bb\u1791\u17d2\u1791\u17c1\u179f\u1780\u17cd\u200b\u17a2\u17b6\u1785\u200b\u200b\u1787\u17b6\u200b\u17a7\u1794\u1780\u179a\u178e\u17cd\u200b\u1798\u178f\u17b7\u17a2\u17d2\u1793\u1780\u1794\u17d2\u179a\u17be\u200b\u178a\u17cf\u1798\u17b6\u1793\u200b\u1794\u17d2\u179a\u179f\u17b7\u1791\u17d2\u1792\u17b7\u1797\u17b6\u1796\u00a0\u17d4", 
