 "Kashmiri ": "\u1780\u17b6\u179f\u17d2\u1798\u17c0\u179a", 
 "<p>The reading activity, as the name \nsuggests, should ask the learner to perform some form of activity. This activity \nshould be directly related to the text the learner has been asked to read. \nFeedback to the activity where appropriate, can provide the learner with some \nreflective guidance.<\/p>": "<p>\u179f\u1780\u1798\u17d2\u1798\u1797\u17b6\u1796\u200b\u17a2\u17b6\u1793 \u178a\u17bc\u1785\u1788\u17d2\u1798\u17c4\u17c7\u200b\u178a\u17c2\u179b\u200b\u179f\u17d2\u1793\u17be \n\u1782\u17bd\u179a\u178f\u17c2\u200b\u179f\u17d2\u1793\u17be\u200b\u17b2\u17d2\u1799\u200b\u17a2\u17d2\u1793\u1780\u179f\u17b7\u1780\u17d2\u179f\u17b6\u200b\u1792\u17d2\u179c\u17be\u200b\u179f\u17c6\u178e\u17bb\u17c6\u1794\u17c2\u1794\u1794\u1791\u200b\u178e\u17b6\u1798\u17bd\u1799\u200b\u1793\u17c3\u200b\u179f\u1780\u1798\u17d2\u1798\u1797\u17b6\u1796\u00a0\u17d4 \u179f\u1780\u1798\u17d2\u1798\u1797\u17b6\u1796\u200b\u1793\u17c1\u17c7 \n\u1782\u17bd\u179a\u178f\u17c2\u200b\u1797\u17d2\u1787\u17b6\u1794\u17cb\u200b\u1791\u17c5\u200b\u17a2\u178f\u17d2\u1790\u1794\u1791\u200b\u178a\u17c2\u179b\u200b\u1794\u17b6\u1793\u200b\u179f\u17d2\u1793\u17be\u200b\u17b2\u17d2\u1799\u200b\u17a2\u17d2\u1793\u1780\u179f\u17b7\u1780\u17d2\u179f\u17b6\u200b\u17a2\u17b6\u1793\u200b\u178a\u17c4\u1799\u200b\u1795\u17d2\u1791\u17b6\u179b\u17cb\u00a0\u17d4 \n\u1795\u17d2\u178a\u179b\u17cb\u200b\u1798\u178f\u17b7\u17a2\u17d2\u1793\u1780\u1794\u17d2\u179a\u17be\u200b\u1785\u17c6\u1796\u17c4\u17c7\u200b\u179f\u1780\u1798\u17d2\u1798\u1797\u17b6\u1796\u200b\u178a\u17c2\u179b\u200b\u179f\u1798\u179a\u1798\u17d2\u1799 \u178a\u17c2\u179b\u17a2\u17b6\u1785\u200b\u1795\u17d2\u178a\u179b\u17cb\u200b\u17b2\u17d2\u1799\u200b\u17a2\u17d2\u1793\u1780\u179f\u17b7\u1780\u17d2\u179f\u17b6 \n\u1793\u17bc\u179c\u200b\u179f\u17c1\u1785\u1780\u17d2\u178a\u17b8\u200b\u178e\u17c2\u1793\u17b6\u17c6\u17a2\u17c6\u1796\u17b8\u200b\u1780\u17b6\u179a\u200b\u1786\u17d2\u179b\u17be\u1799\u00a0\u17d4<\/p>", 
